      "Epoch:  3 , Loss:  [[56548.89146001]] , Val Loss:  [[28273.1091062]]\n",
      "Epoch:  4 , Loss:  [[27926.28746786]] , Val Loss:  [[13962.19288305]]\n",
      "Epoch:  5 , Loss:  [[9283.03528315]] , Val Loss:  [[4640.95192393]]\n",
